css:
/*@import url('https://fonts.googleapis.com/css?family=Raleway');*/
@-moz-document regexp('(https:\/\/cms\.mmu\.edu\.my).*'){
	.PSPAGECONTAINER{
		transform : translateX(-50%);
		position : relative;
		left : 50%;
		font-family: 'Raleway', sans-serif;
	}

	.SSSWEEKLYDAYBACKGROUND{
		padding : 10px 20px;
		font-family: 'Raleway', sans-serif;
		background: #034ea1;
		color: white;
		border-left: solid 1px white;
		border-right: solid 1px white;
		border-top: solid 1px white;
		border-bottom: none;
		min-width: 80px;
		font-size: 12px;
	}

	.SSSWEEKLYA1BACKGROUND{
		font-size: 12px;
		padding : 10px 20px;
		border : none;
		font-family: 'Raleway', sans-serif;
		min-width: 60px;
		background: #034ea1;
		color: white;
		border-left: solid 1px white;
		border-right: solid 1px white;
		border-top: solid 1px white;
		border-bottom: none;
	}

	.SSSWEEKLYTIMEBACKGROUND{
		padding : 10px 20px;
		font-family: 'Raleway', sans-serif;
		font-size: 12px;    
		min-width: 80px;
		border: solid 1px white;
		background: #034ea1;
		color: white;
		border-left: solid 1px white;
		border-right: solid 1px white;
		border-top: solid 1px white;
		border-bottom: none;
	}

	.SSSWEEKLYBACKGROUND{
		padding :0 10px;
		font-family: 'Raleway', sans-serif;
		font-size: 12px;
		border-left: solid 1px white;
		border-right: solid 1px white;
		border-top: solid 1px white;
		border-bottom: none;
		background: #ff5555;
	}

	.SSSTEXTWEEKLY{
		color : white;
		font-family: 'Raleway', sans-serif;
		font-weight: normal;
		font-size: 12px;
		border: none;
	}
	.SSSTEXTWEEKLYTIME{
		font-family: 'Raleway', sans-serif;
		font-weight: normal;
		font-size: 12px;
		background: #034ea1;
		color: white;
		border: none;
	}
	.PSLEVEL3GRID{
		font-family: 'Raleway', sans-serif;
		background : rgb(245, 250, 255);
		border-left: solid 1px white;
		border-right: solid 1px white;
		border-bottom: none;
		border-top : none;
		background: rgb(193,201,219);
	}
}
